NewsFeed\httpsfeedqgisorg\54\content="<p>Les prochaines <b>rencontres des utilisateurs francophones</b> de QGIS auront lieu les 13 et 14 mars 2023 \xe0 Clermont-Ferrand. Comme chaque ann\xe9\x65, elles ont besoin de vous! Vous souhaitez...</p>\r\n<ul>\r\n\r\n<li>Animer un atelier, une conf\xe9rence? </li>\r\n<li>Contribuer par un soutien financier? </li> \r\n<li>Participer \xe0 l'organisation des journ\xe9\x65s?</li>\r\n</ul>\r\n\r\n<p><b>N'h\xe9sitez pas \xe0 nous rejoindre!</b> </p>\r\n\r\n<p>L'appel \xe0 proposition pour les ateliers et conf\xe9rences est ouvert jusqu'au 20 novembre.  \r\nPlus d'infos sur https://conf.qgis.osgeo.fr</p>"
