NewsFeed\httpsfeedqgisorg\56\content="<p>On Friday (27th January 2023) we will be holding our regular monthly QGIS Open Day event! QGIS Open Days promote dialogue and sharing of skills, knowledge and experience within the QGIS community. They are also a great way to sit back and have a little fun with other QGIS users from around the world!</p>\r\n\r\n<p>We hope you will join us for the exciting sessions we have planned. <strong>Double-click this news entry</strong> to find out more! If you cannot join the live event, all sessions will be recorded and uploaded to the official QGIS YouTube channel.</p>"
